  

// TypeScript Version: 4.1

/**
* Rounds a single-precision floating-point number toward positive infinity.
*
* @param x - input value
* @returns rounded value
*
* @example
* var v = ceilf( -4.2 );
* // returns -4.0
*
* @example
* var v = ceilf( 9.99999 );
* // returns 10.0
*
* @example
* var v = ceilf( 0.0 );
* // returns 0.0
*
* @example
* var v = ceilf( NaN );
* // returns NaN
*/
declare function ceilf( x: number ): number;


// EXPORTS //

export = ceilf;
